static int getSteps(char a, char b)
{
  if (a==b)
    return 0;

  if (a=='R')
  {
    if (b=='G') return 1;
    if (b=='B') return 2;
  }
  if(a=='G')
  {
    if (b=='R') return 2;
    if (b=='B') return 1;
  }
  if (a=='B')
  {
    if (b=='G') return 2;
    if (b=='R') return 1;
  }
}

