static char getNext(char c, int steps)
{
  if (steps<0)
    steps += 3;
  if (steps==0)
  {
    return c;
  }
  if(steps==1)
  {
    if (c=='G') return 'B';
    if (c=='R') return 'G';
    if (c=='B') return 'R';
  }
  if (steps==2)
  {
    if (c=='G') return 'R';
    if (c=='R') return 'B';
    if (c=='B') return 'G';
  }

  return 0;
}

static int mix(char a, char b)
{
  if (a==b)
    return a;

  if (a=='R')
  {
    if (b=='G') return 'B';
    if (b=='B') return 'G';
  }
  if(a=='G')
  {
    if (b=='R') return 'B';
    if (b=='B') return 'R';
  }
  if (a=='B')
  {
    if (b=='G') return 'R';
    if (b=='R') return 'G';
  }
  printf("unhandled characters %c and %c\n",a,b);
  return 0;
}

char defaultMix( char *ptr, int length)
{
  int i,j,n;
  char *temp,result;
  if (length==1)
    return ptr[0];
  n = length-1;
  temp = (char*)malloc(n*sizeof(char));
  if (temp)
  {
    for (i=0;i<n;i++)
    {
      temp[i]=mix(ptr[i],ptr[i+1]);
      printf("%c",temp[i]);
    }
    printf("\n");
    for (i=n-1;i>0;i--)
    {
      for (j=0;j<i;j++)
      {
        temp[j]=mix(temp[j],temp[j+1]);
        printf("%c",temp[j]);
      }
      printf("\n");

    }

    result = temp[0];
    free(temp);
  }
  return result;
}
