int reverseAndMix(char* ptr,int length)
{
  int i;
  int m = length/2;
  for (i=0;i<m;i++)
  {
    ptr[i]=mix(ptr[i],ptr[length-1-i]);
  }
  if (length%2)
  {
    ptr[m+1]=0;
    return m+1;
  }
  else
  {
    ptr[m]=0;
    return m;
  }

}
