static char mixPowerOf3(char* ptr, unsigned length)
{
  char temp[3];

  if (length==3) return defaultMix(ptr,length);
  length = length/3;
  temp[0] = mixPowerOf3(ptr,length);
  temp[1] = mixPowerOf3(&ptr[length],length);
  temp[2] = mixPowerOf3(&ptr[2*length],length);
  return defaultMix(temp,3);
}

static char mixPowerOf3PlusOne(char* ptr, unsigned length)
{
  return mix(ptr[0],ptr[length-1]);
}



#define MAX_POW3_NUM  20
static const unsigned long pow3[MAX_POW3_NUM] = {1,3,9,27,81,243,729,2187,6561,19683,
                                       59049,177147,531441,1594323,4782969,
                                       14348907,43046721,129140163,387420489,
                                       1162261467};

enum eLength_type
{
  ePowerOf3,
  ePowerOf3PlusOne,
  eMultipleOfPowerOf3,
  eGeneric,
  eInvalid
};


static enum eLength_type getLengthType(unsigned long length)
{
  int i;
  for (i=0;i<MAX_POW3_NUM;i++)
  {
    if (length<pow3[i])
      break;
  }
  if (i==MAX_POW3_NUM)
    return eInvalid;
  if (i==0)
    return eInvalid;
  i--;
  if (length==pow3[i])
    return ePowerOf3;
  if (length == pow3[i]+1)
    ePowerOf3PlusOne;
  for (;i>0;i--)
  {
    if (length%pow3[i]==0)
      return eMultipleOfPowerOf3;
  }
  return eGeneric;
}
static char lengthBasedMix(char* , unsigned );
static char mixMultipleOfPowerOf3(char* ptr, unsigned length)
{
  unsigned i,l;
  char* temp,result;
  for (l = length;;)
  {
    if (l%3)
      break;
    else
      l=l/3;
  }

  temp = (char*)malloc(l*sizeof(char));
  if (temp==NULL)
  {
    printf("ERROR: malloc\n");
    return 0;
  }
  length = length/l;
  for (i=0;i<l;i++)
  {
    temp[i] = mixPowerOf3(&ptr[i*length],length);
  }
  result = lengthBasedMix(temp,l);
  free(temp);
  return result;
}


static char lengthBasedMix(char* ptr, unsigned length)
{
  unsigned i;
  char *temp;
  char result;
  enum eLength_type t;
  if (length==2)
    return mix(ptr[0],ptr[1]);
  t = getLengthType(length);
  printf("L=%d, type=%i\n",length,t);
  switch (t)
  {
    case ePowerOf3:return mixPowerOf3(ptr,length);
    case ePowerOf3PlusOne:return mixPowerOf3PlusOne(ptr,length);
    case eMultipleOfPowerOf3:return mixMultipleOfPowerOf3(ptr,length);
    case eGeneric:
      if (length<4)
        return defaultMix(ptr,length);
      length--;
      temp = (char*)malloc(length*sizeof(char));
      if (temp==NULL)
      {
        printf("ERROR: malloc\n");
        return 0;
      }
      for (i=0;i<length;i++)
      {
        temp[i]=mix(ptr[i],ptr[i+1]);
      }
      result = lengthBasedMix(temp,length);
      free(temp);
      return result;
    break;
    case eInvalid:
      printf("ERROR: sequence too large\n");
      return 0;
    default:return 0;
  }
  return 0;
}

char myTriangle(const char* row)
{
  unsigned n;
  if (row==NULL)
    return 0;
  n = strlen(row);
  if (n<1)
    return 0;
  if (n==1)
    return row[0];
  if (n==2)
    return mix(row[0],row[1]);
  return lengthBasedMix((char*)row,n);
}

